const axios = require('axios');
let userValue = '';
const getIN = (event)=>{
    userValue = event.target.value;
    console.log(userValue);
    axios({
        url: "https://vpic.nhtsa.dot.gov/api/vehicles/GetModelsForMakeId/440?format=json",
    })
    .then(function(response){console.log(response.data)})
}

const sub = (event)=>{
}
export {getIN, sub};
